css:
.jekyll-manager-panel {
  overflow: auto;
}
.jekyll-manager-panel .block {
  float: left;
  clear: left;
  margin-bottom: 5px;
  padding-left: 10px;
  padding-right: 10px;
  overflow: auto;
  width: 100%;
}
.jekyll-manager-panel .block p {
  margin: 5px;
  float: left;
}
.jekyll-manager-panel .buttons {
  float: right;
  margin-right: 10px;
}
